    # Solution Reference:
    # http://bookshadow.com/weblog/2016/10/23/leetcode-find-all-anagrams-in-a-string/
    #
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        l = []
        cp = collections.Counter(p)
        count = len(p)
        for i in xrange(len(s)):
            if cp[s[i]] >= 1:
                count -= 1
            cp[s[i]] -= 1

            if i >= len(p):
                if cp[s[i-len(p)]] >= 0:
                    count +=1
                cp[s[i-len(p)]] += 1

            if count == 0:
                l.append(i-len(p)+1)
        return l


